INSERT INTO `evento` VALUES (1,'2023-02-10 17:38:36','La Scala-Via Filodrammatici, 2, 20121 Milano MI','Non perdere l\'opportunità di assistere al concerto evento dell\'anno con il talentuoso violinista Caio Vaccari che eseguirà il Violin Concerto op. 64 di Mendelssohn. Vieni ad assaporare questa esperienza unica!','concerto','nocco','Il Violin Concerto op. 64 di Mendelssohn'),(2,'2023-02-10 17:38:36','Alcatraz-Via Valtellina, 25, 20159 Milano MI','Senti l\'energia pulsare in ogni passo! Presentiamo Giuseppe Sollena, ballerino e coreografo che ha reinterpretato il Tiptap con la sua performance unica. Non perdere l\'opportunità di vederlo dal vivo!','balletto','nocco','Vivi l\'energia del Tiptap'),(3,'2023-02-10 17:39:03','Sio Caffè-Via Libero Temolo, 1, 20126 Milano MI','Lasciati trasportare dai beat coinvolgenti di Matteo Salvini in una notte di follia!','concerto','nocco','Il rave più esplosivo dell\'anno con Matteo Salvini: non mancare!');
